}

export function EditBranch() {
  return <div>EditBranch</div>;
}

export function NewBranch() {
  let navigate = useNavigate();

  const [id, setId] = useState();
  const [branchName, setBranchName] = useState();
  const [capacity, setCapacity] = useState();
  const [onService, setOnservice] = useState();
  const [pricePerHour, setPricePerHour] = useState();
  const [description, setDescription] = useState();
  const [location, setLocation] = useState();

  function checkApiResponse(apiResponse) {
    if (apiResponse.status < 500 && apiResponse.status >= 400) {
      console.log(apiResponse.status);

      alert(
        apiResponse.status+
        "Your request wasn't accepted try check the fields and make sure the branch wasn't already registered"
      );
    }
  }

  function newBranchAction() {
    let headersList = {
      'User-Agent': 'Thunder Client (https://www.thunderclient.com)',
      Accept: '/Application/json',
      'Content-Type': 'application/json',
    };

    let bodyContent = JSON.stringify({
      id: id,
      name: branchName,
      location: location,
      description: description,
      capacity: capacity,
      onService: onService,
      pricePerHour: pricePerHour,
    });

    fetch(`${baseUrl}`, {
      method: 'POST',
      body: bodyContent,
      headers: headersList,
    })
      // .then(function (response) {
      //   return response;
      // })
      .then((data) => {
        console.log(data);
        checkApiResponse(data);
      });
    // console.log(response)

    // window.location.replace("/")

    // navigate(`../`);
    // window.location.reload();
  }

  return (
    <form
      className="form"
      id="add-admin-form"
      action=""
      method=""
      onSubmit={(e) => {
        e.preventDefault();
        newBranchAction();
      }}
    >
      <h1 id="formHeader">New Branch</h1>
      <div className="form-group">
        <label for="branchName">Branch Name:</label>
        <input
          type="text"
          className="form-control "
          id="branchName"
          placeholder="Branch Name"
          name="branchName"
          required
          oninvalid="input_error('fullName')"
          onChange={(e) => {
            setBranchName(e.target.value);
          }}
        />
        <div id="branchNameError" className="errorOutput"></div>
      </div>
      <div className="form-group">
        <label for="capacity">Capacity:</label>
        <input
          type="text"
          className="form-control tell"
          id="capacity"
          placeholder="Capacity"
          name="capacity"
          required
          oninvalid="input_error('capacity')"
          onChange={(e) => {
            setCapacity(e.target.value);
          }}
        />
        <div id="capacityError" className="errorOutput"></div>
      </div>

      <div className="form-group">
        <label for="onService" className="pe-4">
          On Service:
        </label>
        <label>
          True
          <input
            type="radio"
            value={true}
            onChange={(e) => setOnservice(e.target.value)}
          />
        </label>
        <label className="ps-2">
          False
          <input
            type="radio"
            value={false}
            onChange={(e) => setOnservice(e.target.value)}
          />
        </label>

        <div id="onServiceError" className="errorOutput"></div>
      </div>
      <div className="form-group">
        <label for="pricePerHour">Price Per Hour:</label>
        <input
          type="text"
          className="form-control password"
          id="pricePerHour"
          placeholder="Price Per Hour"
          name="pricePerHour"
          required
          oninvalid="input_error('pricePerHour')"
          onChange={(e) => {
            setPricePerHour(e.target.value);
          }}
        />
        <div id="pricePerHourError" className="errorOutput"></div>
      </div>
      <div className="form-group">
        <label for="description">Description:</label>
        <input
          type="text"
          className="form-control password"
          id="description"
          placeholder="Description"
          name="description"
          required
          oninvalid="input_error('description')"
          onChange={(e) => {
            setDescription(e.target.value);
          }}
        />
        <div id="passwordError" className="errorOutput"></div>
      </div>
      <div className="form-group">
        <label for="location" id="location">
          Location:
        </label>
        <input
          type="text"
          className="form-control password"
          id="location"
          placeholder="Location"
          name="location"
          required
          oninvalid="input_error('location')"
          onChange={(e) => {
            setLocation(e.target.value);
          }}
        />
        <br />
        <p>
          {' '}
          Guidance to insert a location <br />
          -go to google maps <br />
          -select the location of the branch as a destination <br />
          -go to left menu and select share or embed map <br />
          -select embed map <br />
          -choose the small size <br />
          -copy the text and paste it here <br />
          -from the text you just coppied select the address inside src and copy
          it
          <br />
          -paste it here
        </p>
        <div id="locationError" className="errorOutput"></div>
      </div>
      <div id="errorDisplay"></div>
      <br />
      <button className="btn btn-customized buttonWider" id="addBtn">
        Add Branch
      </button>
    </form>
  );
}

export default function DeleteBranch() {
  return <div>DeleteBranch</div>;
}
